import React from 'react';
import ReactDom from 'react-dom';



ReactDom.render(<>
    <ul>
        <li>sum of two number is {add(40,4)}</li>
        <li>sub of two number is {ad(40,4)}</li>
        <li>div of two number is {add(40,4)}</li>
        <li>multiply of two number is {add(40,4)}</li>

    </ul>
 </>,document.getElementById('root')
);
